import React from "react";
import "./style.css";

function Navbar() {
    return (
        <div className="container">
            <nav className="navbar navbar-expand-lg">
                <a className="navbar-brand logo" href="#">Fesco</a>
                <div className="navbar-"></div>
            </nav>
</div>
    )
}

export default Navbar;
